import React from 'react'
import {
    Box,
    Grid2,
    Typography,
    Container,
    Button,
    Paper,
    TextField,
    MenuItem
} from '@mui/material';


const sizes = [

]

const Form = () => {


    return (
        <Paper variant='outlined'>
            <Grid2 container component='form' direction='column' spacing={2} sx={{ p: 2 }}>
                <TextField fullWidth name='positive' label='Positive Prompt' />
                <TextField fullWidth name='negative' label='Negative Prompt' />
                <Grid2 container direction='row'>
                    <TextField
                        sx={{ flexGrow: 1 }}
                        select
                        label="Select"
                        defaultValue="EUR"
                        helperText="Please select your currency"
                    >
                        {sizes.map((option) => (
                            <MenuItem key={option.value} value={option.value}>
                                {option.label}
                            </MenuItem>
                        ))}
                    </TextField>
                    <TextField
                        sx={{ flexGrow: 1 }}
                        select
                        label="Select"
                        defaultValue="EUR"
                        helperText="Please select your currency"
                    >
                        {sizes.map((option) => (
                            <MenuItem key={option.value} value={option.value}>
                                {option.label}
                            </MenuItem>
                        ))}
                    </TextField>
                </Grid2>
                <Button type='submit' variant='contained' color='primary'>Generate Image</Button>
            </Grid2>
        </Paper>
    )
}

export default Form
